            __builder.AddMarkupContent(1, "<p>\r\n    <b>Various method in the life cycle of Razor Component are:-</b>\r\n    <br><br>\r\n    1.OnInitialized()<br>\r\n    =>It is a synchronous function.It is used to assign Parameters,properties,etc while initializing.For example:If we want to make a dropdown list of city and want to add the values to the dropdown list at the time of initialization the code can be written in this method.\r\n    <br><br>\r\n    2.OnInitializedAsync()<br>\r\n    =>It is an asynchronous method of OnInitialized().Any API call or Call to Database can be written in this method.\r\n    <br>\r\n    <br>\r\n    3.OnParameterSet()<br>\r\n    =>If the component has any parameters those parameters are set in this method.As sson as this method will be invoked the values of the oaramter are set.\r\n    <br>\r\n    <br>\r\n    4.OnParameterAsync()<br>\r\n    =>This is the asynchronous method of ParameterSet method.If the values of the parameter is to be set from database or API the code is written in this method.\r\n    <br>\r\n    <br>\r\n    5.OnAfterRender()<br>\r\n    =>It is called just before the page is rendered.It accepts a parameter firstRender.If it is a firt request then the value of this parameter is false else it is true.\r\n    <br><br>\r\n    6.OnAfterRenderAsync()<br>\r\n    =>It is the asynchromous method of OnAfterRender().This method also accepts the same parameter as that of OnAfterRender().\r\n    <br><br>\r\n    7.ShouldRender()<br>\r\n    =>This gets called when state of the page is changed.If statehaschanged() is executed it will automatically call ShouldRender() and it will further call OnAfterRender or OnAfterRenderAsync.In this case the value of firstRender will be false.\r\n    <br><br>\r\n    8.Dispose()<br>\r\n    =>To use this implement IDisposable interface.It is called when we navigate to another component.All the properties that are set on that component gets disposed.\r\n\r\n\r\n</p>");
